import {ProductItem} from "./product-item";

export class User {
  id: number;
  firstName: string;
  lastName: string;
  maidenName: string;
  age: number;
  gender: string;
  email: string;
  phone: string;
  username: string;
  password: string;
  birthDate: string;
  image: string;
  bloodGroup: string;
  height: number;
  weight: number;
  eyeColor: string;
  hair: Hair;
  domain: string;
  ip: string;
  address: Address;
  macAddress: string;
  university: string;
  bank: Bank;
  company: Company;
  ein: string;
  ssn: string;
  userAgent: string;

  constructor(id: number, firstName: string, lastName: string, maidenName: string, age: number, gender: string, email: string, phone: string, username: string, password: string, birthDate: string, image: string, bloodGroup: string, height: number, weight: number, eyeColor: string, hair: Hair, domain: string, ip: string, address: Address, macAddress: string, university: string, bank: Bank, company: Company, ein: string, ssn: string, userAgent: string) {
    this.id = id;
    this.firstName = firstName;
    this.lastName = lastName;
    this.maidenName = maidenName;
    this.age = age;
    this.gender = gender;
    this.email = email;
    this.phone = phone;
    this.username = username;
    this.password = password;
    this.birthDate = birthDate;
    this.image = image;
    this.bloodGroup = bloodGroup;
    this.height = height;
    this.weight = weight;
    this.eyeColor = eyeColor;
    this.hair = hair;
    this.domain = domain;
    this.ip = ip;
    this.address = address;
    this.macAddress = macAddress;
    this.university = university;
    this.bank = bank;
    this.company = company;
    this.ein = ein;
    this.ssn = ssn;
    this.userAgent = userAgent;
  }
}

class Hair {
  color: string;
  type: string;

  constructor(color: string, type: string) {
    this.color = color;
    this.type = type;
  }
}

class Address {
  address: string;
  city: string;
  coordinates: Coordinates;
  postalCode: string;
  state: string;

  constructor(address: string, city: string, coordinates: Coordinates, postalCode: string, state: string) {
    this.address = address;
    this.city = city;
    this.coordinates = coordinates;
    this.postalCode = postalCode;
    this.state = state;
  }
}

class Coordinates {
  lat: number;
  lng: number;

  constructor(lat: number, lng: number) {
    this.lat = lat;
    this.lng = lng;
  }
}

class Bank {
  cardExpire: string;
  cardNumber: string;
  cardType: string;
  currency: string;
  iban: string;

  constructor(cardExpire: string, cardNumber: string, cardType: string, currency: string, iban: string) {
    this.cardExpire = cardExpire;
    this.cardNumber = cardNumber;
    this.cardType = cardType;
    this.currency = currency;
    this.iban = iban;
  }
}

class Company {
  address: Address;
  department: string;
  name: string;
  title: string;

  constructor(address: Address, department: string, name: string, title: string) {
    this.address = address;
    this.department = department;
    this.name = name;
    this.title = title;
  }
}

export class UsersResponse {
  users: User[];
  total: number;
  skip: number;
  limit: number;


  constructor(users: User[], total: number, skip: number, limit: number) {
    this.users = users;
    this.total = total;
    this.skip = skip;
    this.limit = limit;
  }
}
